
def busca_binaria(lista, item):
    baixo = 0
    alto = len(lista) - 1
    while baixo <= alto:
        meio = int((baixo + alto) / 2)
        find_item = lista[meio]
        if find_item == item:
            return meio
        elif find_item > item:
            alto = meio - 1
        else:
            baixo = meio + 1
    return None

